import React from 'react';


function Inicio() {
    const meses = ['Meses', 'Janeiro', 'Fevereiro', 'Março', 'Maio', 'Junho', 'Julho', 'Agosto', 'Setembro', 'Outubro', 'Novembro', 'Dezembro']
    const nowMonth = meses[new Date().getMonth()]
    return (
        <div>

            <div className="card border-dark shadow cardmensal" style={{ width: '18rem' }}>
                <div className="card-body">
                    <div className="font-weight-bold text-success text-uppercase mb-1">Faturamento {nowMonth} </div>
                    <div className="h5 mb-0 font-weight-bold text-gray-800">R$ 40,000</div>
                </div>
            </div>
        </div>
    )
}

export default Inicio;
